import React from 'react';
import logo from './logo.svg';
import './App.css';

class App extends React.Component {

  render() {
    return (
      //Create Header!
      <header>
        <form id="to-do-form">
          <input type="text" placeholder="Enter to-do"/>
          <button type="submit">Add to-do item!</button>
        </form>
      </header>
    );
  }
}

export default App;
